// Parse Google Maps HTML response
const input = $input.first();
const html = input.json.data || input.binary?.data?.toString() || '';

// Get metadata from previous node
const metadata = $node["Build Search Query"].json;

// Function to extract data between strings
function extractBetween(str, start, end) {
  const startIdx = str.indexOf(start);
  if (startIdx === -1) return null;
  const startPos = startIdx + start.length;
  const endIdx = str.indexOf(end, startPos);
  if (endIdx === -1) return null;
  return str.substring(startPos, endIdx);
}

// Function to clean and parse JSON
function safeJsonParse(str) {
  try {
    return JSON.parse(str);
  } catch (e) {
    return null;
  }
}

// Extract business data from the response
const results = [];

// Method 1: Look for structured data in script tags
const scriptMatches = html.match(/<script[^>]*>([\s\S]*?)<\/script>/gi) || [];

for (const script of scriptMatches) {
  const content = script.replace(/<\/?script[^>]*>/gi, '');

  // Look for place data patterns
  if (content.includes('"place_id"') || content.includes('place_id')) {
    // Try to extract JSON objects
    const jsonMatches = content.match(/\{[^{}]*(?:\{[^{}]*\}[^{}]*)*\}/g) || [];

    for (const jsonStr of jsonMatches) {
      const data = safeJsonParse(jsonStr);
      if (data && (data.place_id || data.name)) {
        results.push(data);
      }
    }
  }
}

// Method 2: Extract from data attributes and specific patterns
const placeRegex = /data-place-id=["']([^"']+)["']/g;
let match;
while ((match = placeRegex.exec(html)) !== null) {
  const placeId = match[1];

  // Try to find associated data
  const nameMatch = html.match(new RegExp(`["']name["']\s*:\s*["']([^"']+)["'][^}]*place_id["']\s*:\s*["']${placeId}`, 'i'));

  if (nameMatch) {
    results.push({
      place_id: placeId,
      name: nameMatch[1]
    });
  }
}

// Method 3: Parse embedded JSON-LD structured data
const jsonLdMatches = html.match(/<script type="application\/ld\+json">([\s\S]*?)<\/script>/gi) || [];

for (const jsonLd of jsonLdMatches) {
  const content = jsonLd.replace(/<\/?script[^>]*>/gi, '');
  const data = safeJsonParse(content);

  if (data) {
    if (Array.isArray(data)) {
      results.push(...data);
    } else if (data['@type'] === 'LocalBusiness' || data.name) {
      results.push(data);
    }
  }
}

// If no results found, try basic HTML parsing
if (results.length === 0) {
  // Look for div elements with aria-label containing business info
  const businessDivs = html.match(/aria-label=["']([^"']*(?:restaurant|business|store|shop)[^"']*)["']/gi) || [];

  businessDivs.forEach((div, idx) => {
    const nameMatch = div.match(/aria-label=["']([^"']+)["']/i);
    if (nameMatch) {
      results.push({
        name: nameMatch[1],
        source: 'aria-label',
        index: idx
      });
    }
  });
}

// Return results with metadata
return [{
  json: {
    ...metadata,
    total_found: results.length,
    raw_results: results,
    html_length: html.length,
    extraction_method: results.length > 0 ? 'success' : 'needs_selenium',
    message: results.length > 0 
      ? `Found ${results.length} potential businesses` 
      : 'Google Maps requires JavaScript - consider using Puppeteer/Selenium'
  }
}];

