// Regex matches Moroccan Landlines (05...) and Mobiles (06/07...)
// Formats: 05222-02025, 05 22 20 20 25, +212 5...
const phoneRegex = /(?:\+212|0)[ \-]*(?:5|6|7)[ \-\d]{8,12}/;

const match = html.match(phoneRegex);
const phone = match ? match[0] : "Not Found";

// Regex for Website (looks for the primary website button link)
const websiteRegex = /<a[^>]*href="([^"]*)"[^>]*data-pcu="([^"]*)"/i;
const webMatch = html.match(websiteRegex);
const website = webMatch ? webMatch[1] : "Not Found";

return [{
  json: {
    business_name: item.business_name,
    phone_number: phone,
    website: website,
    source_url: item.url
  }
}];
